import React, { FC, memo } from 'react';
import AEMLogo from '../images/skills/aem-logo.png';
import ReactLogo from '../images/skills/React-Symbol.png';
import TypeScriptLogo from '../images/skills/typescript.jpg';
import JavaScriptLogo from '../images/skills/javascript-logo.jpg';
import './Skills.scss';

const Skills: FC = () => {
  return (
    <div className='skills'>
      <h2>Skills</h2>
      <div className='skills__list'>
        <div className='skills__list-item'>
          <img src={AEMLogo} alt='Adobe Experience Manager logo' />
        </div>
        <div className='skills__list-item'>
          <img src={ReactLogo} alt='React logo' />
        </div>
        <div className='skills__list-item'>
          <img src={TypeScriptLogo} alt='Type Script Logo' />
        </div>
        <div className='skills__list-item'>
          <img src={AEMLogo} alt='Adobe Experience Manager' />
        </div>
        <div className='skills__list-item'>
          <img src={AEMLogo} alt='Adobe Experience Manager' />
        </div>
        <div className='skills__list-item'>
          <img src={AEMLogo} alt='Adobe Experience Manager' />
        </div>
      </div>
    </div>
  );
};
export default memo(Skills);
